@title AIAgentVault
@notice Trustless vault for AI-managed trading on Hyperliquid
@dev Integrates with HyperCore precompiles for oracle prices and trading

@notice Initialize the vault
@param _depositToken USDC token address on HyperEVM
@param _keeperBot Keeper bot address
@param _aiAgent AI agent address

@notice Authorize a trade (called by AI agent)
@param perpIndex Perpetual index to trade
@param isLong Trade direction
@param size Position size in USDC
@param leverage Leverage amount
@param maxSlippage Maximum allowed slippage
@param stopLoss Stop loss price
@param takeProfit Take profit price

@notice Execute an authorized trade (called by keeper bot)
@param signalId Signal ID of the authorized trade
@param executionPrice Actual execution price from L1
@param actualSize Actual executed size

@notice Update performance metrics (called by keeper bot)
@param totalPnL Current total P&L
@param sharpeRatio Current Sharpe ratio

@notice Get current oracle price from HyperCore
@param perpIndex Perpetual index
@return price Oracle price (scaled by 1e6)

@notice Check if an asset is allowed for trading
@param perpIndex Perpetual index to check
@return Whether the asset is allowed

@title L1Read
@notice Interface for reading data from HyperCore L1 via precompiles
@dev Based on official Hyperliquid L1Read.sol specification

@notice Get oracle price for a perpetual asset
@param index Perpetual index
@return price Oracle price (scaled by 1e6)

@notice Get spot metadata for an asset
@param index Spot asset index
@return meta Spot metadata

@notice Get perpetual metadata
@param index Perpetual index
@return meta Perpetual metadata

@notice Get perpetual asset information
@param index Perpetual index
@return info Asset information

@notice Get user's position for a perpetual
@param user User address
@param perpIndex Perpetual index
@return position User's position data

@notice Get user's spot balance
@param user User address
@param spotIndex Spot asset index
@return balance User's spot balance

@notice Get user's perpetual balance (margin)
@param user User address
@return balance User's perpetual margin balance

@notice Convert raw oracle price to standard format
@param rawPrice Raw price from oracle
@param szDecimals Size decimals for the asset
@return price Converted price (scaled by 1e18)

@notice Get all oracle prices for a list of perpetuals
@param indices Array of perpetual indices
@return prices Array of oracle prices

@notice Calculate total portfolio value for a user
@param user User address
@param perpIndices Perpetual indices to check
@param spotIndices Spot indices to check
@return totalValue Total portfolio value in USDC (1e6)

@notice Check if a position is at risk of liquidation
@param user User address
@param perpIndex Perpetual index
@param maintenanceMarginRate Maintenance margin rate (basis points)
@return atRisk Whether position is at risk
@return marginRatio Current margin ratio

@title VaultFactory
@notice Factory contract for deploying AI Agent Vaults with performance tracking
@dev Manages vault creation, registry, and on-chain performance leaderboard

@notice Create a new AI Agent Vault
@param name Vault name
@param description Vault description
@param strategyType Trading strategy type
@param aiAgent AI agent address
@param keeperBot Keeper bot address
@param tradingConfig Initial trading configuration
@return vault Address of the deployed vault

@notice Update performance metrics for a vault
@param vault Vault address
@dev Can only be called by the vault's keeper bot

@notice Compare performance of two vaults
@param vaultA First vault
@param vaultB Second vault
@return comparison 1 if A > B, -1 if A < B, 0 if equal

@notice Get top performing vaults
@param count Number of vaults to return
@return vaults Array of vault addresses
@return performances Array of performance records

@notice Get all vaults created by a user
@param user User address
@return Array of vault addresses

@notice Get detailed vault information
@param vault Vault address
@return metadata Vault metadata
@return performance Performance record

@notice Search vaults by strategy type
@param strategyType Strategy type to search for
@return Array of matching vault addresses

@notice Deactivate a vault
@param vault Vault address
@dev Can only be called by vault creator

@notice Update factory configuration
@param _maxVaultsPerUser New maximum vaults per user
@param _vaultCreationFee New vault creation fee

@notice Get aggregate statistics across all vaults
@return totalAUM Total assets under management
@return totalVolume Total trading volume
@return averageReturn Average return across all vaults
